@Component injects the specified properties into the View.prototype.

view-module.html.body:
View ModuleInterfaceinterface View extends Backbone.NativeView {
  constructor(options?: ngBackbone.ViewOptions);
  render(): View;
  listenToMap( eventEmitter: Backbone.Events, event: ngBackbone.DataMap ): View;
  remove(): View;
}

View creates an instance of ngTemplate based on specified bounding element and template code. It binds models/collections of the given maps to the template. E.g. models: { foo: new Model() } becomes available in the template scope as foo. As soon the model changes (this.models.get("foo").set("bar", "value")) the template responds (foo.bar === "value");import { Component, View, Model, Collection } from "../ng-backbone/core";

@Component({
  el: "ng-hero",
  models: {
    hero: new Model({
      "name": "Superman"
    })
  },
  collections: {
    powers: new Collection([
      { name: "Superhuman strength" },
      { name: "Flight" }
      { name: "Freezing breath" }
    ])
  },

  template: `
     has powers:



`
})

export class HeroView extends FormView {

  initialize() {
    this.render();
  }

}

view-options.html.body:
View OptionsInterfaceinterface ngBackbone.ViewOptions extends Backbone.ViewOptions {
  models?: Models | {}; // injected shared model map
  collections?: Collections | {}; // injected shared collection map
  formValidators?: { [key: string]: Function; }; // form validator map
  logger?: LoggerOption; // subscribe for logging events
  views?: Views; // constructors for nested views
}
As you can see from the ViewOptions interface, we can create once option/model map and pass it into view. It makes possible to have shared models and collections across the views. When any of shared model/collection changes, all the related views synchronize:let heroes = new HeroCollection();

new HeroView({ collections: { heroes: heroes } });
new HeroListView({ collections: { heroes: heroes } });

subviews.html.body:
SubviewsWe can make our view to create automatically nested views by specifying a list of view constructors: @Component({
    views: {
      foo: FooView,
      bar: BarView
    }
  })
In this case nested view expects el view option filled with a selector relative to the parent view.  View object calls subview constructors after the first rendering. So it has inner DOM subtree already available and can bind subviews in there.  After subviews instantiated we can find them within this.view map of the parent view. If destroy a view with this.remove(), it automatically destroys every subview.When we need passing options to subview constructor, we can use the following syntax: @Component({
    views: {
      foo: [ FooView, { id: "foo" }],
      bar: [ BarView, { id: "bar" }]
    }
  })
Within parent component child ones are available in views map. You can access the instance of a sub-component as this.views.get( "name" ). Thus we obtain the control over child component from the parent:@Component({
  el: "ng-hello",
  events: {
    "click [data-bind=toggleFoo]" : "toggleFoo",
    "click [data-bind=toggleBar]" : "toggleBar"
  },
  views: {
    foo: FooView,
    bar: BarView
  },
  template: `
  Show Foo
  Show Bar
   `
})

class AppView extends View {
  toggleFoo(){
    this.views.get( "foo" ).toogle();
  }
  toggleBar(){
    this.views.get( "bar" ).toogle();
  }
}

logging-events.html.body:
Logging Eventslog.sync - fires every time the template synchronizes

log.listen - fires when View subscribes a model or a collection

log.template - fires on template warnings

You can subscribe for view events like that:let logger = {
  "log:sync log:template": function( msg: string, ...args: any[] ): void {
      console.log( `LOG(${this.cid}):`, msg, args );
   }
};

new FooView({ logger: logger });

formview-module.html.body:
FormView ModuleThis module is developed to simplify working forms. What do we usually do with Backbone? We subscribe for control change events and write view methods that update view as its state changes. FormView does it for us. It extracts the groups marked in the template with data-ng-group="groupName".
Within every found group it collects all the available controls input[name], textarea[name], select[name] and binds it to state models respectively. So when state of a control/group changes (e.g. validation fails) that gets available within the template immediately.For example we have a template:


    Invalid value


Until anything typed in to the input, it's invalid according to required restrictor. Thus template variable foo.bar.valid is false and the template shows container with error message. If we typed in a wrong value for email address foo.bar.valid again has 'false' and we can see the message. We can also access the sate of the group as foo.group. See below Control/Group State Model Interface for available properties.Interfaceinterface FormView extends View {
  getData( groupName: string ): ngBackbone.DataMap;
}
Form ValidationFormView subscribes for "input", "change" and "focus" events on the found controls. Whenever an event fires it updates the ControlState. If the state model reports that valid or touched property changed, FormView updates the GroupState.FormView contains following built-in validators:valueMissing - if the control has required attribute and an empty value, ControlState.valueMissing is set false

patternMismatch - if the control has pattern attribute and a value that does not match the specified pattern, ControlState.patternMismatch is set false

rangeOverflow - if the control has max attribute and a value greater than specified in the attribute, ControlState.rangeOverflow is set false

rangeUnderflow - if the control has min attribute and a value less than specified in the attribute, ControlState.rangeUnderflow is set false

typeMismatch - if the control has type email, tel or url and a value that does not match the corresponding type, ControlState.typeMismatch is set false

If any of validations fails ControlState.validationMessage receives the corresponding error message.Examples:

  Name is required

..





ViewForm Exampleimport { Component, FormView } from "ng-backbone/core";


@Component({
  el: "ng-hero",
  events: {
    "submit form": "onSubmitForm"
  },
  template: `


    Name



      Name is invalid 


    Hero Power

        Superhuman strength
        Flight
        Freezing breath




      Power is invalid 


    Submit



`
})

export class HeroView extends FormView {

  initialize() {
    this.render();
  }

  onSubmitForm( e:Event ){
    e.preventDefault();
    alert( "Form submitted" );
  }

}

Custom Type ValidationYou can set up your own custom type validators like that:@Component({
  el: "ng-hero",
  formValidators: {
    hexcolor( value: string ): Promise {
        let pattern = /^#(?:[0-9a-f]{3}){1,2}$/i;
        if ( pattern.test( value  ) ) {
          return Promise.resolve();
        }
        return Promise.reject( "Please enter a valid hexcolor e.g. #EEEAAA" );
      }
  },
  template: `




`
})

Every validator is a callback that returns a Promise. If validation passes the Promised resolves. Otherwise it rejects with error message passed as an argumentRemote Type ValidationYou can also have a validation that happens on the server.
import { Component, FormView, FormValidators, Debounce } from "ng-backbone/core";

class CustomValidators extends FormValidators {
   @Debounce( 350 )
   name( value: string ): Promise {
      return NamerModel.fetch();
   }
}

@Component({
  el: "ng-hero",
  formValidators: CustomValidators,
  template: `




`
})

FormView class the validator with every input event that is by default debounced 100ms. For validation via XHR request you may need greater debounce. We use @Debounce() validator to set it.

state-model.html.body:
State ModelInterfaceinterface State extends Backbone.Model {
}
Control State ModelForView creates and binds ControlState to every control found in the target group.Interfaceinterface ControlState extends State {
  value:    string,
  valid:    boolean,  // Control's value is valid
  touched:  boolean, // Control has been visited
  dirty:    boolean, // Control's value has changed
  valueMissing: boolean, // indicating the element has a required attribute, but no value.
  rangeOverflow: boolean, // indicating the value is greater than the maximum specified by the max attribute.
  rangeUnderflow: boolean, // indicating the value is less than the minimum specified by the min attribute.
  typeMismatch: boolean, // indicating the value is not in the required syntax
  patternMismatch: boolean, // indicating the value does not match the specified pattern
  validationMessage: string
}
Group State ModelForView creates and binds GroupState to every target group.Interfaceinterface GroupState extends State {
  valid:    boolean,  // Control's value is valid
  dirty:    boolean // Control's value has changed
}
